import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import ProductCard from '../components/ProductCard';
import api from '../services/api';
import './Home.css';

const Home = () => {
  const [featuredProducts, setFeaturedProducts] = useState([]);
  const [latestProducts, setLatestProducts] = useState([]);
  const [categories, setCategories] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [featuredRes, latestRes, categoriesRes] = await Promise.all([
          api.get('/products/featured'),
          api.get('/products?limit=8&sort=createdAt'),
          api.get('/categories')
        ]);

        setFeaturedProducts(featuredRes.data.products || []);
        setLatestProducts(latestRes.data.products || []);
        setCategories(categoriesRes.data.categories || []);
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  if (loading) return <div className="loading">Loading...</div>;

  return (
    <div className="home-page">
      <section className="hero-section">
        <div className="container">
          <div className="slide-content">
            <div className="slide-text">
              <h1>Always fresh <span className="highlight">GROCERIES</span></h1>
              <p>Farm fresh products delivered to your doorstep</p>
              <Link to="/products" className="shop-now-btn">Shop Now!</Link>
            </div>
            {/* You could add a hero image here if available */}
          </div>
        </div>
      </section>

      <section className="categories-section">
        <div className="container">
          <h2 className="section-title">Shop by Category</h2>
          <div className="category-boxes">
            {categories.map(category => (
              <Link to={`/products?category=${category._id}`} key={category._id} className="category-box">
                {category.image && category.image.url && (
                  <img src={category.image.url} alt={category.name} className="category-image" />
                )}
                <h3>{category.name}</h3>
              </Link>
            ))}
          </div>
        </div>
      </section>

      <section className="featured-section">
        <div className="container">
          <h2 className="section-title">Featured Products</h2>
          <div className="products-grid">
            {featuredProducts.length > 0 ? (
              featuredProducts.map(product => (
                <ProductCard key={product._id} product={product} />
              ))
            ) : (
              <p className="no-products">No featured products found.</p>
            )}
          </div>
        </div>
      </section>

      <section className="latest-section">
        <div className="container">
          <h2 className="section-title">New Arrivals</h2>
          <div className="products-grid">
            {latestProducts.length > 0 ? (
              latestProducts.map(product => (
                <ProductCard key={product._id} product={product} />
              ))
            ) : (
              <p className="no-products">No new products found.</p>
            )}
          </div>
        </div>
      </section>

      <section className="info-banners">
        <div className="container">
          <div className="banner-grid">
            <div className="info-banner">
              <span className="banner-icon">üöö</span>
              <div>
                <h3>Free Delivery</h3>
                <p>On orders above ‚Çπ500</p>
              </div>
            </div>
            <div className="info-banner">
              <span className="banner-icon">‚≠ê</span>
              <div>
                <h3>Quality Guarantee</h3>
                <p>100% organic products</p>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
